import './App.css';
import React, { useState } from 'react';

function App() {
  const names = ["\"Kushal Chattopadhyay\"", "\"কুশল চট্টোপাধ্যায়\"", "\"クシャル・チャットパディヤイ\""];
  const [currentName, setCurrentName] = useState(names[0]);

  const change = () => {
    const nextName = names[Math.floor(Math.random()*10)+1];
    setCurrentName(nextName);
    setTimeout(() => setCurrentName(nextName), 1000);
  };

  const revert = () => {
    const nextName = names[0];
    setTimeout(() => setCurrentName(nextName), 1000);
  };

  return (
    <div className="App" style={{ display: 'flex', alignItems: 'center', margin: "50 0 0 0", height: '100vh' }}>
      <h1 onMouseEnter={change} onMouseOut={revert} style={{ fontFamily: "Helvetica Neue" }} id="name">
        {currentName}
      </h1>
    </div>

  );
}

export default App;
